  const getData = () =>{
      // add url here
      axios.get('http://192.168.137.1:8000') 
      .then(res => {
          console.log('Data fetcted from backend!')
          setData(res.data)
          console.log(res.data)
          console.log(res.data)
      }).catch(err => {
          console.log(err)
      })
  }
  // display data from the json
  return <div>
        {getData()}
      {/* maps */}
      {newData.staff && newData.staff.map((item, index) => {
          return <div key={index}>
